import "./style.scss";
import React from 'react';
import { saveProfile } from './saveprofile';
import {setProfile} from './setprofile'
 

export class Profile extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      issaveprofile: true
    };
  }

  render() {
    return (
      <div className="App">
        <div className="page">
              <saveProfile />
              <setProfile />
            
        </div>
      </div>
    );
  }
}
